}

.desktop-only {
display: none !important;
}

table.tiles tr.tiles-tr,
table.tiles tr.tiles-tr td.tiles-td {
display: block !important;
width: 100% !important;
}

.tiles-between {
height: 50px;
}

table.tiles tr.tiles-tr {
display: flex !important;
flex-direction: column;
}

.faux-position{
margin-top: 200px;
}

.match-rate-container {
width: 180px;
height: 98px;
}

.match-rate-container > table {
height: 98px;
}

.match-rate-content-wrapper {
height: 54px;
}

.match-rate-content-inner-wrapper {
height: 50px;
}

.headhunter-top-padding,
.headhunter-top-padding td {
height: 40px;
}
.over-mob {
min-height: 190px !important;
}

.gradient-table {
height: 650px !important;
}

.mobile-shift {
height: 240px !important;
}
}

